(self.webpackChunkdapengdouyu=self.webpackChunkdapengdouyu||[]).push([[9450],{2192:function(e){"use strict";e.exports=JSON.parse('{"blogPosts":[{"id":"pdf","metadata":{"permalink":"/pdf","source":"@site/blog/2021-10-09-pdf.md","title":"\u5982\u4f55\u4f7f pdf \u6587\u4ef6\u5728\u6d4f\u89c8\u5668\u91cc\u9762\u76f4\u63a5\u4e0b\u8f7d\u800c\u4e0d\u662f\u6253\u5f00","description":"\u5982\u4f55\u4f7f pdf \u6587\u4ef6\u5728\u6d4f\u89c8\u5668\u91cc\u9762\u76f4\u63a5\u4e0b\u8f7d\u800c\u4e0d\u662f\u6253\u5f00","date":"2021-10-09T00:00:00.000Z","formattedDate":"October 9, 2021","tags":[{"label":"JavaScript","permalink":"/tags/java-script"},{"label":"pdf","permalink":"/tags/pdf"},{"label":"\u4e0b\u8f7d","permalink":"/tags/\u4e0b\u8f7d"}],"readingTime":2.52,"truncated":true,"authors":[{"name":"dapeng","title":"\u524d\u7aef\u5f00\u53d1\u8005"}],"nextItem":{"title":"Redux \u539f\u7406\u5206\u6790","permalink":"/redux-analysis"}},"content":"## \u524d\u8a00\\n\\n\u5728\u505a\u9700\u6c42\u8fc7\u7a0b\u4e2d\u6211\u4eec\u5927\u6982\u7387\u4f1a\u9047\u5230\u5728\u6d4f\u89c8\u5668\u4e2d\u4e0b\u8f7d\u6587\u4ef6\u7684\u9700\u6c42\uff0c\u5982\u679c\u4ec5\u4ec5\u662f\u8fd9\u4e2a\u8981\u6c42\u7684\u8bdd\u5f88\u7b80\u5355\uff0c\u6709\u5982\u4e0b\u4e24\u79cd\u89e3\u51b3\u65b9\u5f0f\u3002\\n\x3c!--truncate--\x3e\\n\u7b2c\u4e00\u79cd\u662f\u901a\u8fc7 `window `\u5bf9\u8c61\u7684 `open` \u65b9\u6cd5\u8fdb\u884c\u64cd\u4f5c\uff0c\u5c06\u6587\u4ef6 `url`\u76f4\u63a5\u5728\u6d4f\u89c8\u5668\u4e2d\u6253\u5f00\u5373\u53ef\u4e0b\u8f7d\u3002\\n\\n```js\\nwindow.open(\\"url\\");\\n```\\n\\n\u7b2c\u4e8c\u79cd\u662f\u901a\u8fc7 `a` \u6807\u7b7e\uff0c\u8bbe\u7f6e `href` \u4e3a `url` \u503c\uff0c\u70b9\u51fb `a` \u6807\u7b7e\u5373\u53ef\u5b8c\u6210\u4e0b\u8f7d\u3002\\n\\n```js\\n<a href=\\"url\\" download=\\"\u6587\u4ef6\u540d\\"></a>\\n```\\n\\n\u4f46\u662f\u4e0a\u9762\u4e24\u79cd\u6587\u4ef6\u4e0b\u8f7d\u65b9\u5f0f\u90fd\u4f1a\u5b58\u5728\u4e00\u4e2a\u95ee\u9898\uff0c\u5c31\u662f pdf \u6587\u4ef6\u4f1a\u76f4\u63a5\u5728\u6d4f\u89c8\u5668\u4e2d\u6253\u5f00\u800c\u4e0d\u662f\u76f4\u63a5\u4e0b\u8f7d\uff0c\u6548\u679c\u5982\u4e0b\uff1a\\n![\u9884\u89c8](/img/blog/1.gif)\\n\\n## \u89e3\u51b3\u65b9\u6848\\n\\n\u8fd9\u79cd\u9700\u6c42\u7684\u89e3\u51b3\u65b9\u5f0f\u5c31\u662f\u5c06 PDF \u6587\u4ef6\u7684 `MIME type` \u6539\u4e3a `application/octet-stream` \u5e76\u52a0\u5165 `Content-Disposition:attachment header`\uff0c\u539f\u672c\u7684 pdf \u6587\u4ef6 `MIME type `\u4e3a `application/pdf`\uff0c\u6d4f\u89c8\u5668\u8bc6\u522b\u5230\u8fd9\u4e2a `type` \u4e4b\u540e\u4f1a\u81ea\u52a8\u5728\u6d4f\u89c8\u5668\u6253\u5f00\uff0c\u6240\u4ee5\u8bf4\u6211\u4eec\u5728\u8fd9\u91cc\u4fee\u6539 `type` \u5373\u53ef\u3002\\n\\n\u4fee\u6539\u7684\u65b9\u6cd5\u6709\u4e24\u79cd\uff0c\u4e00\u79cd\u662f\u5728`\u540e\u7aef`\u8fdb\u884c\u4fee\u6539\uff0c\u4e0a\u4f20\u6587\u4ef6\u6216\u8005\u8fd4\u56de\u6587\u4ef6\u7684\u65f6\u5019\u8fdb\u884c\u64cd\u4f5c\uff0c\u4f46\u662f\u7edd\u5927\u591a\u6570\u60c5\u51b5\u4e0b\u6587\u4ef6\u90fd\u662f\u5b58\u50a8\u5230 `cdn `\u670d\u52a1\u5668\u4e2d\u7684\uff0c\u540e\u7aef\u4e5f\u4e0d\u65b9\u4fbf\u5bf9\u5176\u8fdb\u884c\u64cd\u4f5c\uff0c\u8fd9\u4e2a\u65f6\u5019\u5c31\u9700\u8981\u524d\u7aef\u6765\u4fee\u6539\u4e86\u3002\\n\\n\u5904\u7406\u4ee3\u7801\u5982\u4e0b\uff1a\\n\\n```js\\n/**\\n * @deprecated \u4e0b\u8f7d\u6587\u4ef6\\n * @param {string} url\\n * @param {string} filename\\n */\\nhandleFileDownload = (url, filename) => {\\n  // \u521b\u5efa a \u6807\u7b7e\\n  let a = document.createElement(\\"a\\");\\n  a.href = url;\\n  a.download = filename;\\n  a.click();\\n};\\n\\n/**\\n * @deprecated \u5904\u7406 pdf url\uff0c\u4f7f\u5176\u4e0d\u5728\u6d4f\u89c8\u5668\u6253\u5f00\\n * @param {string} url\\n */\\nhandlePdfLink = (url, filename) => {\\n  fetch(url, {\\n    method: \\"get\\",\\n    responseType: \\"arraybuffer\\",\\n  })\\n    .then(function (res) {\\n      if (res.status !== 200) {\\n        return res.json();\\n      }\\n      return res.arrayBuffer();\\n    })\\n    .then((blobRes) => {\\n      // \u751f\u6210 Blob \u5bf9\u8c61\uff0c\u8bbe\u7f6e type \u7b49\u4fe1\u606f\\n      const e = new Blob([blobRes], {\\n        type: \\"application/octet-stream\\",\\n        \\"Content-Disposition\\": \\"attachment\\",\\n      });\\n      // \u5c06 Blob \u5bf9\u8c61\u8f6c\u4e3a url\\n      const link = window.URL.createObjectURL(e);\\n      handleFileDownload(link, filename);\\n    })\\n    .catch((err) => {\\n      console.error(err);\\n    });\\n};\\n```\\n\u8fd9\u6837\u4fee\u6539\u4fee\u6539\u4ee3\u7801\u7684\u8bdd\u5c31\u53ef\u4ee5\u5b9e\u73b0\u5728\u6d4f\u89c8\u5668\u4e2d\u4e0b\u8f7d\u3002\u6548\u679c\u5982\u4e0b\\n![\u9884\u89c8](/img/blog/2.gif)"},{"id":"redux-analysis","metadata":{"permalink":"/redux-analysis","source":"@site/blog/2021-08-19-redux-analysis.md","title":"Redux \u539f\u7406\u5206\u6790","description":"Redux \u539f\u7406\u5206\u6790","date":"2021-08-19T00:00:00.000Z","formattedDate":"August 19, 2021","tags":[{"label":"JavaScript","permalink":"/tags/java-script"},{"label":"SourceCode","permalink":"/tags/source-code"}],"readingTime":6.195,"truncated":true,"authors":[{"name":"Cansiny0320","title":"\u524d\u7aef\u5f00\u53d1\u8005","url":"https://github.com/Cansiny0320","imageURL":"https://cansiny.oss-cn-shanghai.aliyuncs.com/images/1618298366420-logo.jpg"}],"prevItem":{"title":"\u5982\u4f55\u4f7f pdf \u6587\u4ef6\u5728\u6d4f\u89c8\u5668\u91cc\u9762\u76f4\u63a5\u4e0b\u8f7d\u800c\u4e0d\u662f\u6253\u5f00","permalink":"/pdf"}},"content":"## Redux \u7684\u6838\u5fc3\u601d\u60f3\\n\\nRedux \u662f JavaScript \u72b6\u6001\u5bb9\u5668\uff0c\u80fd\u63d0\u4f9b\u53ef\u9884\u6d4b\u5316\u7684\u72b6\u6001\u7ba1\u7406\u3002\\n\\n\x3c!--truncate--\x3e\\n\\n\u5b83\u8ba4\u4e3a\uff1a\\n\\n- Web \u5e94\u7528\u662f\u4e00\u4e2a\u72b6\u6001\u673a\uff0c\u89c6\u56fe\u4e0e\u72b6\u6001\u662f\u4e00\u4e00\u5bf9\u5e94\u7684\u3002\\n- \u6240\u6709\u7684\u72b6\u6001\uff0c\u4fdd\u5b58\u5728\u4e00\u4e2a\u5bf9\u8c61\u91cc\u9762\u3002\\n\\n\u6211\u4eec\u5148\u6765\u770b\u770b \u201c\u72b6\u6001\u5bb9\u5668\u201d\u3001\u201c\u89c6\u56fe\u4e0e\u72b6\u6001\u4e00\u4e00\u5bf9\u5e94\u201d \u4ee5\u53ca \u201c\u4e00\u4e2a\u5bf9\u8c61\u201d \u8fd9\u4e09\u4e2a\u6982\u5ff5\u7684\u5177\u4f53\u4f53\u73b0\u3002\\n\\n![](https://cansiny.oss-cn-shanghai.aliyuncs.com/images/1629290427369.png)\\n\\n\u5982\u4e0a\u56fe\uff0cStore \u662f Redux \u4e2d\u7684\u72b6\u6001\u5bb9\u5668\uff0c\u5b83\u91cc\u9762\u5b58\u50a8\u7740\u6240\u6709\u7684\u72b6\u6001\u6570\u636e\uff0c\u6bcf\u4e2a\u72b6\u6001\u90fd\u8ddf\u4e00\u4e2a\u89c6\u56fe\u4e00\u4e00\u5bf9\u5e94\u3002\\n\\nRedux \u4e5f\u89c4\u5b9a\uff0c\u4e00\u4e2a State \u5bf9\u5e94\u4e00\u4e2a View\u3002\u53ea\u8981 State \u76f8\u540c\uff0cView \u5c31\u76f8\u540c\uff0c\u77e5\u9053\u4e86 State\uff0c\u5c31\u77e5\u9053 View \u662f\u4ec0\u4e48\u6837\uff0c\u53cd\u4e4b\u4ea6\u7136\u3002\\n\\n\u6bd4\u5982\uff0c\u5f53\u524d\u9875\u9762\u5206\u4e09\u79cd\u72b6\u6001\uff1aloading\uff08\u52a0\u8f7d\u4e2d\uff09\u3001success\uff08\u52a0\u8f7d\u6210\u529f\uff09\u6216\u8005 error\uff08\u52a0\u8f7d\u5931\u8d25\uff09\uff0c\u90a3\u4e48\u8fd9\u4e09\u4e2a\u5c31\u5206\u522b\u552f\u4e00\u5bf9\u5e94\u7740\u4e00\u79cd\u89c6\u56fe\u3002\\n\\n\u73b0\u5728\u6211\u4eec\u5bf9 \u201c\u72b6\u6001\u5bb9\u5668\u201d \u4ee5\u53ca \u201c\u89c6\u56fe\u4e0e\u72b6\u6001\u4e00\u4e00\u5bf9\u5e94\u201d \u6709\u6240\u4e86\u89e3\u4e86\uff0c\u90a3\u4e48 Redux \u662f\u600e\u4e48\u5b9e\u73b0\u53ef\u9884\u6d4b\u5316\u7684\u5462\uff1f\u6211\u4eec\u518d\u6765\u770b\u4e0b Redux \u7684\u5de5\u4f5c\u6d41\u7a0b\u3002\\n\\n![](https://cansiny.oss-cn-shanghai.aliyuncs.com/images/1629355306002.png)\\n\\n\u9996\u5148\uff0c\u6211\u4eec\u770b\u4e0b\u51e0\u4e2a\u6838\u5fc3\u6982\u5ff5\uff1a\\n\\n- Store\uff1a\u4fdd\u5b58\u6570\u636e\u7684\u5730\u65b9\uff0c\u4f60\u53ef\u4ee5\u628a\u5b83\u770b\u6210\u4e00\u4e2a\u5bb9\u5668\uff0c\u6574\u4e2a\u5e94\u7528\u53ea\u80fd\u6709\u4e00\u4e2a Store\u3002\\n- State\uff1aStore \u5bf9\u8c61\u5305\u542b\u6240\u6709\u6570\u636e\uff0c\u5982\u679c\u60f3\u5f97\u5230\u67d0\u4e2a\u65f6\u70b9\u7684\u6570\u636e\uff0c\u5c31\u8981\u5bf9 Store \u751f\u6210\u5feb\u7167\uff0c\u8fd9\u79cd\u65f6\u70b9\u7684\u6570\u636e\u96c6\u5408\uff0c\u5c31\u53eb\u505a State\u3002\\n- Action\uff1aState \u7684\u53d8\u5316\uff0c\u4f1a\u5bfc\u81f4 View \u7684\u53d8\u5316\u3002\u4f46\u662f\uff0c\u7528\u6237\u63a5\u89e6\u4e0d\u5230 State\uff0c\u53ea\u80fd\u63a5\u89e6\u5230 View\u3002\u6240\u4ee5\uff0cState \u7684\u53d8\u5316\u5fc5\u987b\u662f View \u5bfc\u81f4\u7684\u3002Action \u5c31\u662f View \u53d1\u51fa\u7684\u901a\u77e5\uff0c\u8868\u793a State \u5e94\u8be5\u8981\u53d1\u751f\u53d8\u5316\u4e86\u3002\\n- Action Creator\uff1aView \u8981\u53d1\u9001\u591a\u5c11\u79cd\u6d88\u606f\uff0c\u5c31\u4f1a\u6709\u591a\u5c11\u79cd Action\u3002\u5982\u679c\u90fd\u624b\u5199\uff0c\u4f1a\u5f88\u9ebb\u70e6\uff0c\u6240\u4ee5\u6211\u4eec\u5b9a\u4e49\u4e00\u4e2a\u51fd\u6570\u6765\u751f\u6210 Action\uff0c\u8fd9\u4e2a\u51fd\u6570\u5c31\u53eb Action Creator\u3002\\n- Reducer\uff1aStore \u6536\u5230 Action \u4ee5\u540e\uff0c\u5fc5\u987b\u7ed9\u51fa\u4e00\u4e2a\u65b0\u7684 State\uff0c\u8fd9\u6837 View \u624d\u4f1a\u53d1\u751f\u53d8\u5316\u3002\u8fd9\u79cd State \u7684\u8ba1\u7b97\u8fc7\u7a0b\u5c31\u53eb\u505a Reducer\u3002Reducer \u662f\u4e00\u4e2a\u51fd\u6570\uff0c\u5b83\u63a5\u53d7 Action \u548c\u5f53\u524d State \u4f5c\u4e3a\u53c2\u6570\uff0c\u8fd4\u56de\u4e00\u4e2a\u65b0\u7684 State\u3002\\n- dispatch\uff1a\u662f View \u53d1\u51fa Action \u7684\u552f\u4e00\u65b9\u6cd5\u3002\\n- subscribe\uff1a\u8ba2\u9605\u6570\u636e\u53d8\u5316\u3002\u4e00\u65e6 state \u53d1\u751f\u6539\u53d8\uff0c\u6267\u884c\u56de\u8c03\u3002\\n\\n\u7136\u540e\u6211\u4eec\u8fc7\u4e0b\u6574\u4e2a\u5de5\u4f5c\u6d41\u7a0b\uff1a\\n\\n1. \u9996\u5148\uff0c\u7528\u6237\uff08\u901a\u8fc7 View\uff09\u53d1\u51fa Action\uff0c\u53d1\u51fa\u65b9\u5f0f\u5c31\u7528\u5230\u4e86 dispatch \u65b9\u6cd5\u3002\\n2. \u7136\u540e\uff0cStore \u81ea\u52a8\u8c03\u7528 Reducer\uff0c\u5e76\u4e14\u4f20\u5165\u4e24\u4e2a\u53c2\u6570\uff1a\u5f53\u524d State \u548c\u6536\u5230\u7684 Action\uff0cReducer \u4f1a\u8fd4\u56de\u65b0\u7684 State\\n3. State \u4e00\u65e6\u6709\u53d8\u5316\uff0cStore \u5c31\u4f1a\u8c03\u7528\u76d1\u542c\u51fd\u6570\uff0c\u6765\u66f4\u65b0 View\u3002\\n\\n\u5230\u8fd9\u513f\u4e3a\u6b62\uff0c\u4e00\u6b21\u7528\u6237\u4ea4\u4e92\u6d41\u7a0b\u7ed3\u675f\u3002\u53ef\u4ee5\u770b\u5230\uff0c\u5728\u6574\u4e2a\u6d41\u7a0b\u4e2d\u6570\u636e\u90fd\u662f\u5355\u5411\u6d41\u52a8\u7684\uff0c\u8fd9\u79cd\u65b9\u5f0f\u4fdd\u8bc1\u4e86\u6d41\u7a0b\u7684\u6e05\u6670\u3002\\n\\n## \u6e90\u7801\u5206\u6790\\n\\n\u6e90\u7801\u5206\u6790\u4f7f\u7528\u7b80\u5316\u7248\u4ee3\u7801\uff0c\u70b9\u51fb\u67e5\u770b[\u5b8c\u6574\u4ee3\u7801](https://github.com/Cansiny0320/mini-redux)\\n\\n### createStore\\n\\ncreateStore \u662f redux \u7684\u4e3b\u6d41\u7a0b\\n\\n```js\\nexport default function createStore(reducer, preloadedState, enhancer) {\\n  // \u4e2d\u95f4\u4ef6\\n  if (enhancer) {\\n    return enhancer(createStore)(reducer, preloadedState)\\n  }\\n  let currentReducer = reducer\\n  let state = preloadedState\\n  let listeners = []\\n\\n  function getState() {\\n    return state\\n  }\\n\\n  function subscribe(listener) {\\n    let isSubscribed = true\\n    listeners.push(listener)\\n    return function unsubscribe() {\\n      if (!isSubscribed) return\\n      isSubscribed = false\\n      listeners.splice(index, 1)\\n    }\\n  }\\n\\n  function dispatch(action) {\\n    state = currentReducer(state, action)\\n    listeners.forEach(listener => listener())\\n    return action\\n  }\\n\\n  function replaceReducer(nextReducer) {\\n    currentReducer = nextReducer\\n    dispatch({ type: Symbol(\'REPLACE\') })\\n    return store\\n  }\\n  // \u5728\u6ca1\u6709\u4f20 preloadedState \u7684\u65f6\u5019\uff0c\u521d\u59cb\u5316 state\\n  dispatch({ type: Symbol(\'INIT\') })\\n\\n  return {\\n    dispatch,\\n    subscribe,\\n    getState,\\n    replaceReducer,\\n  }\\n}\\n```\\n\\n\u6838\u5fc3\u7684\u4ee3\u7801\u662f\u8fd9\u4e9b\\n\\n```js\\nlet currentReducer = reducer\\nlet state = preloadedState\\nlet listeners = []\\n\\nfunction subscribe(listener) {\\n  let isSubscribed = true\\n  listeners.push(listener)\\n  return function unsubscribe() {\\n    // \u9632\u6b62\u91cd\u590d\u8c03\u7528\\n    if (!isSubscribed) return\\n    isSubscribed = false\\n    listeners.splice(index, 1)\\n  }\\n}\\n\\nfunction dispatch(action) {\\n  state = currentReducer(state, action)\\n  listeners.forEach(listener => listener())\\n  return action\\n}\\n```\\n\\n\u53ef\u4ee5\u770b\u5230\uff0c`subscribe`\u51fd\u6570\u5c06\u6211\u4eec\u4f20\u5165\u7684`listener`\u52a0\u5165`listeners`\u6570\u7ec4\uff0c\u7136\u540e\u5728 dispatch`\u7684\u65f6\u5019\u6267\u884c\u6bcf\u4e2a`listener`\uff0c\u8fd9\u6837\u5c31\u8fbe\u5230\u4e86\u66f4\u65b0\u8ba2\u9605\u7684\u76ee\u7684\\n\\n`subscribe`\u51fd\u6570\u8fd8\u4f1a\u8fd4\u56de\u4e00\u4e2a`unsubscribe`\u51fd\u6570\uff0c\u7528\u6765\u53d6\u6d88\u8ba2\u9605\u7684`listener`\\n\\n### combineReducers\\n\\ncombineReducers \u662f\u7528\u6765\u5408\u5e76\u591a\u4e2a reducer \u7684\u51fd\u6570\\n\\n```js\\nexport default function combineReducers(reducers) {\\n  const reducerKeys = Object.keys(reducers)\\n  return function combination(state, action) {\\n    const nextState = {}\\n    reducerKeys.forEach(key => {\\n      const reducer = reducers[key]\\n      // \u4e4b\u524d\u7684 key \u7684 state\\n      const previousStateForKey = state[key]\\n      // \u6267\u884c \u5206 reducer\uff0c\u83b7\u5f97\u65b0\u7684 state\\n      const nextStateForKey = reducer(previousStateForKey, action)\\n      nextState[key] = nextStateForKey\\n    })\\n    return nextState\\n  }\\n}\\n```\\n\\n\u5176\u5b9e\u5c31\u662f\u6839\u636e\u4e0d\u540c\u7684`key`\uff0c\u62ff\u5230\u5bf9\u5e94\u7684`reducer`\u548c`state`\u518d\u8fdb\u884c\u66f4\u65b0\\n\\n### applyMiddleware\\n\\napplyMiddleware \u662f\u5b9e\u73b0\u4e2d\u95f4\u4ef6\u652f\u6301\u7684\u51fd\u6570\\n\\n```js\\n//  \u628a compose(f, g, h) \u8f6c\u6362\u6210 (...args) => f(g(h(...args)))\\nconst compose = (...funcs) =>\\n  funcs.reduce(\\n    (a, b) =>\\n      (...args) =>\\n        a(b(...args))\\n  )\\n\\nexport default function applyMiddleware(...middlewares) {\\n  return createStore => (reducer, preloadedState) => {\\n    const store = createStore(reducer, preloadedState)\\n    const middlewareAPI = {\\n      getState: store.getState,\\n    }\\n    const chain = middlewares.map(middleware => middleware(middlewareAPI))\\n    const dispatch = compose(...chain)(store.dispatch)\\n    store.dispatch = dispatch\\n    return store\\n  }\\n}\\n```\\n\\n\u8f83\u4e3a\u5173\u952e\u7684\u662f\u8fd9\u4e00\u6b65`const dispatch = compose(...chain)(store.dispatch)`\uff0c\u5c06\u4e2d\u95f4\u4ef6\u8fdb\u884c\u7ec4\u5408\\n\\n\u5230\u73b0\u5728\u4e3a\u6b62\u6211\u4eec\u5df2\u7ecf\u5b9e\u73b0\u4e86 redux \u7684\u4e3b\u8981\u529f\u80fd\uff0c\u8fd8\u6709\u4e00\u4e9b\u5c0f\u7ec6\u8282\u5c31\u4e0d\u7ee7\u7eed\u6df1\u5165\u4e86\uff0c\u73b0\u5728\u6211\u4eec\u518d\u6765\u770b\u770b redux \u7684\u5de5\u4f5c\u6d41\u7a0b\uff0c\u662f\u4e0d\u662f\u6e05\u6670\u591a\u5566\uff1f\\n\\n![](https://cansiny.oss-cn-shanghai.aliyuncs.com/images/1629355306002.png)\\n\\n## \u53c2\u8003\u6587\u7ae0\\n\\n[Redux \u4ece\u8bbe\u8ba1\u5230\u6e90\u7801](https://tech.meituan.com/2017/07/14/redux-design-code.html)\\n\\n[\u5b8c\u5168\u7406\u89e3 redux](https://github.com/brickspert/blog/issues/22)"}]}')}}]);